  \"2015-11-18T09:34:37.850177\",\n\t\"name\": \"2012-census-of-agriculture-web-maps\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Census of Agriculture provides a detailed
  picture every five years of U.S. farms and ranches and the people who operate them.
  Conducted by USDAu2019s National Agricultural Statistics Service, the 2012 Census
  of Agriculture collected more than six million data items directly from farmers.
  The Ag Census Web Maps application makes this information available at the county
  level through a few clicks. The maps and accompanying data help users visualize,
  download, and analyze Census of Agriculture data in a geospatial context.\",\n\t\"license_title\":
